import axios from 'axios';
import { error } from 'console';
import { map } from 'lodash';
import { useState } from 'react';

function SignUp() {
  const [conutrys, getContrys] = useState([]);
  const apiSignUp = axios
    .get('http://api.training.div3.pgtest.co/api/v1/location')
    .then((res) => getContrys(res.data.data))
    .catch((error) => console.log(error));

  return (
    <div>
      <input type="text" placeholder="Email" />
      <input type="text" placeholder="Password" />
      <input type="text" placeholder="Name" />
      <input type="text" placeholder="Gioi tinh" />
      <select name="cars" id="cars">
        <option value="volvo">--Quoc gia--</option>
        {conutrys.map((country) => (
          <option key={country.id}>{country.name}</option>
        ))}
      </select>
    </div>
  );
}

export default SignUp;
